import './App.css';
import React from 'react'
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom" 

function App() {
  return (
    <Router>
    <div className="App">
      <ul>
        <li>Dashboard</li>
        <li>Product List</li>
      </ul>
    </div>
    </Router>
  );
}

export default App;
